int N = sizeof(a) / sizeof(a[0]);

#define THREADS 8

typedef struct {
    int start;
    int end;
} params_t;

void *bubble_sort(void *arg) {
    params_t *params = (params_t *) arg;
    int i, j, temp;

    for (i = params->start; i < params->end; i++) {
        for (j = params->start; j < params->end - 1; j++) {
            if (a[j] > a[j + 1]) {
                temp = a[j];
                a[j] = a[j + 1];
                a[j + 1] = temp;
            }
        }
    }

    pthread_exit(NULL);
}

void parallel_bubble_sort() {
    int i;
    pthread_t threads[THREADS];
    params_t params[THREADS];

    for (i = 0; i < THREADS; i++) {
        params[i].start = (N / THREADS) * i;
        params[i].end = (N / THREADS) * (i + 1);

        pthread_create(&threads[i], NULL, bubble_sort, &params[i]);
    }

    for (i = 0; i < THREADS; i++) {
        pthread_join(threads[i], NULL);
    }

    // Merge the sorted halves of the array
    int left[N/2], right[N/2];
    for (i = 0; i < N/2; i++) {
        left[i] = a[i];
        right[i] = a[i + N/2];
    }

    int l = 0, r = 0, k = 0;
    while (l < N/2 && r < N/2) {
        if (left[l] < right[r]) {
            a[k++] = left[l++];
        } else {
            a[k++] = right[r++];
        }
    }

    while (l < N/2) {
        a[k++] = left[l++];
    }

    while (r < N/2) {
        a[k++] = right[r++];
    }
}

int main() {

    printf("Arr size = %d", N);

    parallel_bubble_sort();

    return 0;
}